import {useState} from "react";

function HomeAnimal(){
    const [count,setCount]=useState(["lev ",1])

    const countplus=()=>{
        let countplus=count+1
        return(
            setCount(countplus)
        )
    }
    return(
        <div>
            <button onClick={()=>{countplus()}}>+</button>
            <p>{count}</p>
        </div>
    )
}
export default HomeAnimal;
